/* Procedure structure for procedure `DatosPos_Exportar` */

/*!50003 DROP PROCEDURE IF EXISTS  `DatosPos_Exportar` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`ncsoftwa_re`@`%` PROCEDURE `DatosPos_Exportar`()
BEGIN
DROP TABLE IF EXISTS exportar_fondo_caja;
CREATE TABLE exportar_fondo_caja
	AS SELECT * FROM fondocaja WHERE `FechaFONP` = curdate()
;
DROP TABLE IF EXISTS exportar_tesoreria_movimientos;
CREATE TABLE exportar_tesoreria_movimientos
	AS SELECT * FROM tesoreriamovimientos 
	WHERE `FechaTESM` = CURDATE()
;
DROP TABLE IF EXISTS exportar_ventas;
CREATE TABLE exportar_ventas
	AS SELECT * FROM ventas 
	WHERE `FechaVEN` >= CURDATE() and FechaVEN < CURDATE() + 1
;
DROP TABLE IF EXISTS exportar_ventas_detalle;
CREATE TABLE exportar_ventas_detalle
    AS SELECT 
      `IdDVEN`
    , `IdVentaDVEN`
    , `IdLocalDVEN`
    , `IdArticuloDVEN`
    , `DescripcionDVEN`
    , `CantidadDVEN`
    , `PrecioPublicoDVEN`
    , `PrecioCostoDVEN`
    , `PrecioMayorDVEN`
    , `IdFormaPagoDVEN`
    , `NroCuponDVEN`
    , `NroFacturaDVEN`
    , `IdEmpleadoDVEN`
    , `LiquidadoDVEN`
    , `EsperaDVEN`
    , `DevolucionDVEN`
    FROM ventas_detalle_export_cons 
    WHERE `FechaVEN` >= CURDATE() AND FechaVEN < CURDATE() + 1
;
END */$$
DELIMITER ;

